import{Buildable}from"../../interface/buildable.min.js";import{ProgrammingLanguageHelpModel}from"../../model/help/programming-language-help-model.min.js";import{Utility}from"../../shared/utility.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.min.js";class ProgrammingLanguageHelpController extends Buildable{constructor(){super(),this.model=new ProgrammingLanguageHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new ProgrammingLanguageHelpController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=async()=>{const e=this.model.getProgrammingLanguages();for(let r=0;r<e.length;r++){const t=e[r],a=[];a.push(this.createNoTd(r)),a.push(this.createNameTd(t)),a.push(this.createDescriptionTd(t));const s=`<tr>${a.join("")}</tr>`;$("#help-info tr:last").after(s)}(await PageColorAdjuster.build()).changeBackgroundColor(),$("body").addClass("loaded")};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const r=e+1;return this.createTd(`<p style='text-align:center;'>${r}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-programming-language" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`)}export{ProgrammingLanguageHelpController};